import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

export default function HOOKS() {
    const [name,setName] = useState('');
    const [email,setEmail] = useState('');
    const [password,setPassword] = useState('');

  const nameChangeHandler = (e) =>{
     setName(e.target.value);
  }
  const emailChangeHandler = (e) =>{
    setEmail(e.target.value);
 }
 const passwordChangeHandler = (e) =>{
  setPassword(e.target.value);
}
const formSubmitHandler = (e) =>{
 console.log("form is submitted ");
 console.log(name,email,password);
 e.preventDefault();
}

  return (
     <div>
      <div className='row'>
      <div className='col-md-6 offset-3 p-3'>
      <Form action="" onSubmit={formSubmitHandler}>
      <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Name</Form.Label>
      <Form.Control type="text" value={name} placeholder="Enter name" required onChange={nameChangeHandler} />
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Email address</Form.Label>
      <Form.Control type="email" value={email} placeholder="Enter email" required onChange={emailChangeHandler} />
    </Form.Group>

    <Form.Group className="mb-3" controlId="formBasicPassword">
      <Form.Label>Password</Form.Label>
      <Form.Control type="password" value={password} placeholder="Password" required onChange={passwordChangeHandler} />
    </Form.Group>
    <Button variant="primary" type="submit">
      Register
    </Button>
  </Form>
        </div>
      </div>
     </div>

  )
}
